import React from "react";
import { render } from "react-dom";
import Admin from "./admin/components/App";
import User from "./user/components/App";

import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <Route exact path="/">
      <Firstpage />
    </Route>
  );
}

render(
  <BrowserRouter>
    <App />
    <User />
    <Admin />
  </BrowserRouter>,
  document.getElementById("root")
);
